import React from "react";

export default function PreferidosInicio() {
  return (
    <div className="card" style={{ maxWidth: 900, margin: "40px auto" }}>
      <h2>Inicio Preferidos</h2>
      <p>Bienvenido a tus favoritos</p>
    </div>
  );
}
